
// Using native fetch

async function testPrimary() {
    const apiUrl = 'https://slip-c.oiioioiiioooioio.download/';
    // Minimal valid 1x1 pixel base64 jpeg
    const dummyImage = 'data:image/jpeg;base64,';

    console.log('Testing Primary API:', apiUrl);

    try {
        const payload = {
            img: dummyImage,
            tos: true,
            privacy: true,
            eula: true
        };

        const res = await fetch(apiUrl, {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json',
            },
            body: JSON.stringify(payload)
        });

        console.log('Status:', res.status, res.statusText);
        console.log('Headers:', res.headers.raw ? res.headers.raw() : res.headers);

        const text = await res.text();
        console.log('Raw Body:', text.substring(0, 500)); // Print first 500 chars

        try {
            const json = JSON.parse(text);
            console.log('Parsed JSON:', JSON.stringify(json, null, 2));
        } catch (e) {
            console.log('Failed to parse JSON body');
        }

    } catch (err) {
        console.error('Request Failed:', err.message);
    }
}

testPrimary();
